const i=JSON.parse('{"key":"v-7aa999e1","path":"/en/train/eda/chip-circuit/Part_4-chip_concepts/4_7_%E7%89%A9%E7%90%86%E8%AE%BE%E8%AE%A1%E4%B8%AD%E7%9A%84OCV.html","title":"4.7 理解和应对OCV","lang":"en-US","frontmatter":{"title":"4.7 理解和应对OCV","order":7},"headers":[{"level":2,"title":"背景：","slug":"背景","link":"#背景","children":[]},{"level":2,"title":"变异源：","slug":"变异源","link":"#变异源","children":[{"level":3,"title":"I. 工艺变异：","slug":"i-工艺变异","link":"#i-工艺变异","children":[]},{"level":3,"title":"II. 电压变异：","slug":"ii-电压变异","link":"#ii-电压变异","children":[]},{"level":3,"title":"III. 温度变异：","slug":"iii-温度变异","link":"#iii-温度变异","children":[]}]},{"level":2,"title":"芯片内变异的影响：","slug":"芯片内变异的影响","link":"#芯片内变异的影响","children":[]},{"level":2,"title":"如何处理OCV：","slug":"如何处理ocv","link":"#如何处理ocv","children":[]}],"git":{"createdTime":1723131714000,"updatedTime":1723131714000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":10.49,"words":3147},"filePathRelative":"en/train/eda/chip-circuit/Part_4-chip_concepts/4_7_物理设计中的OCV.md","localizedDate":"August 8, 2024","excerpt":"<p>在物理设计中，OCV是指芯片内部电路实际性能与标准预期性能之间的差异。简单来说，OCV描述了芯片内不同区域之间的电性能变化情况。这种变化可能是由于制造过程中的不完美或环境条件的波动引起的。</p>\\n<p>在本文中，我们将讨论VLSI中 OCV [On-Chip Variation：芯片内变异] 的来源，为什么会发生芯片内变异以及如何在物理设计中处理芯片内变异。我们还将简要讨论 AOCV [Advance On Chip Variation：高级芯片内变异] 和 POCV [Parametric On Chip Variation：参数化芯片内变异]。</p>\\n<h2> 背景：</h2>\\n","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{i as data};
